import './App.css';
import { BrowserRouter, Router, Switch } from 'react-router-dom';
import Home from './pages/Home';
import Login from './pages/Login'

function App() {
  return (
    <BrowserRoute>
        <Switch>
          <Router exact path="/" component={ Home } />
          <Router path="/login" component={ Login } />
        </Switch>
    </BrowserRoute>
  );
}

export default App;
